import { createSlice } from '@reduxjs/toolkit'

const initialState = [
    { id: '0', name: 'Ahna Wahid'},
    { id: '1', name: 'Ane Kelete'},
    { id: '2', name: 'Seleste Gual'}
]
const usersSlice = createSlice({
    name: 'users',
    initialState,
    reducers:{}
})

export default usersSlice.reducer
